import Plot from 'react-plotly.js';

function Statsboard() {
    return (
        <div>
            <Plot 
                data={[
                    {
                        x: [1, 2, 3],
                        y: [2, 6, 3],
                        type: 'scatter',
                        mode: 'lines+markers',
                        marker: {color: 'red'},
                    },
                ]}
                layout={ 
                    {width: 320,
                     height: 240, 
                     title: 'A Fancy Plot'} }
             />
        </div>
    )
};

export default Statsboard;
